import './App.css';
import { BrowserRouter as Router, Swtich, Route } from 'react-router-dom';
import Header from './containers/Header';

function App() {
  return (
    <div className="App">
      <Router>
        <Header/>
        <Route path="/" exact component={ProductListing} />
        <Route path="/product/:productId" component={ProductDetail} />
      </Router>
    </div>
  );
}

export default App;
